sys_variable_value.value:
(function execute(inputs, outputs) {
  var str = inputs.string;
  var regex = new RegExp(inputs.preceding_word + '\\s(\\w+)');
  outputs.match = str.match(regex)[1];
  var source = regex.source;
  gs.info(source);
  gs.info(outputs.match);
})(inputs, outputs);

